。沐老三认出飞镖是肖志仓所独有暗器，欲杀肖志仓为王德彪报仇。肖志仓武功远胜沐老三，但回到家后却发现妻子死于非命，二女儿失踪，沐老三成为最大嫌疑人。于是肖、沐二人势不两立，沐老三远避他乡，独自抚养了肖志仓的小女儿，取名“沐晓英”。我们的故事是从十八年后一个小渔村开始。原本在小渔村过着平静生活的沐晓英，精灵古怪，好打不平。不料一夜之间陡生意外，父亲沐老三成为庙村客栈纵火案的嫌犯，三人死亡，沐老三失踪。在私家侦探方瀚文的帮助下，沐晓英决定到天津卫寻找自己的父亲探明真相。女警官肖雅杰就发现了沐晓英的身份，欲捕捉沐晓英引出沐老三。方瀚文几次帮助沐晓英躲过了危机，但是沐晓英却发现方瀚文是肖雅杰的男朋友，也是天津警备司令方炳坤的儿子，而肖雅杰则是当地首富肖志仓的大女儿。于是肖、方、沐三家又因为下一代的关系紧紧联系在一起。方瀚文的真实身份是北洋政府的特别探员，负责寻求那笔神秘宝藏的真相，而目前他唯一的线索只是知道沐老三与此事有关，所以只能紧紧跟着沐晓英；肖雅杰和沐晓英都不知道父辈的纠葛和宝藏的秘密，只在天津卫上演着猫捉老鼠一般的对抗游戏，也是在对抗当中，两人有惺惺相惜的亲近感，直至义结金兰。方瀚文也喜欢上聪明伶俐的沐晓英，对肖雅杰又难以割舍。他也不明白自己的多情到底是为了完成上级任务，还是出于真心……";s:13:"vod_play_from";s:48:"gqm3u8$$$dbm3u8$$$zuidam3u8$$$172m3u8$$$subom3u8";s:15:"vod_play_server";s:22:"no$$$no$$$no$$$no$$$no";s:13:"vod_play_note";s:12:"$$$$$$$$$$$$";s:12:"vod_play_url";s:7139:"01$https://gqnew1.gqzyz.com/20190806/aQlpJbDn/index.m3u8#02$https://gqnew1.gqzyz.com/20190806/U7JZ0NKL/index.m3u8#03$https://gqnew1.gqzyz.com/20190806/mvYD5SZP/index.m3u8#04$https://gqnew1.gqzyz.com/20190806/dGtjbbpS/index.m3u8#05$https://gqnew1.gqzyz.com/20190806/gOqpMlGA/index.m3u8#06$https://gqnew1.gqzyz.com/20190806/HCQiMRDS/index.m3u8#07$https://gqnew1.gqzyz.com/20190806/0n9dwlsY/index.m3u8#08$https://gqnew1.gqzyz.com/20190806/YjI1vtMR/index.m3u8#09$https://gqnew1.gqzyz.com/20190821/WP6JMmK4/index.m3u8#10$https://gqnew1.gqzyz.com/20190821/WYKX3T5q/index.m3u8#11$https://gqnew1.gqzyz.com/20190821/SK9DIT75/index.m3u8#12$https://gqnew1.gqzyz.com/20190821/tm3YMk8J/index.m3u8#13$https://gqnew1.gqzyz.com/20190821/4AJIBwZa/index.m3u8#14$https://gqnew1.gqzyz.com/20190821/5eNrk1hI/index.m3u8#15$https://gqnew1.new1-youku.com/20190826/ULkJTFD1/index.m3u8#16$https://gqnew1.new1-youku.com/20190826/6JCwpY5a/index.m3u8#17$https://gqnew1.new1-youku.com/20190826/mr0EOr4k/index.m3u8#18$https://gqnew1.new1-youku.com/20190826/JxnZXQtU/index.m3u8#19$https://gqnew1.new1-youku.com/20190826/hkpxqTQF/index.m3u8#20$https://gqnew1.new1-youku.com/20190826/1O3A3ZhT/index.m3u8$$$01$https://dbx5.tyswmp.com/20190806/yoIVDNvS/index.m3u8#02$https://dbx5.tysw