810590;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2987:"《玉帝传奇》借助中国古代神话传说中的人物，演绎出一段段人间的挚爱真情玉帝与演对手戏的玉兄，成为全剧矛盾纠葛的中心线索；他们独特、复杂、多层面的性格特征，在戏剧冲突中得以充分展示。 　　御兄、御弟的争斗，是在老玉帝选择接班人的比武中开始的。御兄本性顽劣，争强斗狠，不服任何人；御弟却与御兄性格迥异，虽聪慧过人，武功高强，却以慈善之心待人，一腔悲悯情怀。在比武中，玉弟不忍伤害玉兄，战成平手。关键时刻，玉帝笃守诚信；玉兄则不择手段，几乎成功继位。一直到加冕仪式将要开始，玉兄的凶残嘴脸才败露，仓皇逃往人间。而此时的玉弟，正默默承受着内心极度痛苦的煎熬：他要为自己的仁慈付出代价，那就是不仅失去皇位，还将失去自己心爱的水雾仙子。 　　玉帝（御兄逃窜后，御弟继位）是中国人心目中的理想人物。他宽厚善良，大慈大悲，疾恶如仇，不惜牺牲，拯救百姓于水火之中。《玉》剧在塑造玉帝这个人物时，无疑给他戴上了理想化的光环。但《玉》剧中的玉帝毕竟是人，因而感人至深。他曾以最大限度的慈善宽容对待凶残丑恶，有时几乎到了懦弱的程度，幻想着感化他们。残酷的现实使玉帝渐渐清醒、成熟，懂得了除恶务尽。《玉》剧中的玉帝，保持了中国人最易接受的性格特征，如慈善为本，邪不压正，善恶终有报等，表现出中国传统文化中特有的人文思想。玉帝的结局，终于战胜邪恶，得到了爱情、友情、亲情，也是人们熟悉的大团圆结局。 片断照(18张)　　御兄是《玉》剧中的大恶大凶。但在人物性格的处理上，并未脸谱化，而是细腻的表现了他的渐变过程，以及性格的多层面、复杂性，刻画出一个有血有肉的活生生的人物。御兄恃才自傲，漠视他人；只要自己想得到的，就不顾一切，不择手段。比武争帝位时，御兄明知御弟在忍让他，却讥笑玉弟懦弱，不是敢作敢为、果断行事之人。应该说，这时玉兄和玉弟的冲突，还基本上是性格差异所致。待到玉兄逃到凡间，隐姓埋名、卧薪尝胆，聚妖闹事时，他性格中本质的东西才逐渐显露，原来具有的骁勇、聪颖变成凶残、阴毒。御兄不顾一切地争夺帝位，同时是在不顾一切地争夺水雾仙子。当他败逃凡间，遇到碧瑶时，怦然心动，把所有的失落都转变成浓烈的爱意。 　　在御兄残忍、冷酷的心中，惟有对碧瑶的一缕情丝尚存。即使碧瑶认清了御兄的丑恶，与他刀枪相见时，御兄仍没有放弃幻想。这时，我们已经不知道，御兄穷毕精力争夺的东西，是天宫的龙椅，还是心中所爱？抑或是两者皆有？孰轻孰重？&nbsp;";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1524:"第01集$https://www.qzamfz.com/20190826/WZsDnE3e/index.m3u8#第02集$https://www.qzamfz.com/20190826/xV7MYgeF/index.m3u8#第03集$https://www.qzamfz.com/20190826/x0gz7OLu/index.m3u8#第04集$https://www.qzamfz.com/20190826/fSe8MrEi/index.m3u8#第05集$https://www.qzamfz.com/20190826/IjlCaGHK/index.m3u8#第06集$https://www.qzamfz.com/20190826/YaHX5RDs/index.m3u8#第07集$https://www.qzamfz.com/20190826/iRq2IA18/index.m3u8#第08集$https://www.qzamfz.com/20190826/Ttu8KW7N/index.m3u8#第09集$https://www.qzamfz.com/2019082